import {useState} from 'react'
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import './Register.css'

const Register = () => {

    const [form,setForm] = useState({
        name:'',
        job:'',
    })
    const handleInputChange = (e) =>{
        const {name,value} = e.target

        setForm({
            [name]:value
        })
    }

    return(
        <>
            <div>
                <TextField label='Digite o seu Nome' variant='standard' name='name' value={form.name} onChange={handleInputChange}/>
            </div>

            <div>
                <TextField label='Digite o seu Cargo' variant='standard' name='job' value={form.job} onChange={handleInputChange}/>
            </div>

            <div>
                <Button variant='contained' color='primary'>
                    Cadastrar
                </Button>
            </div>
        </>
    )
}

export default Register
